import { createApp } from 'vue';
import App from './App.vue';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.css';
import { createRouter, createWebHistory } from 'vue-router';
import EtatEdit from './components/pages/EtatEdit';
		import EtatShow from './components/pages/EtatShow';
		import PrestationEdit from './components/pages/PrestationEdit';
		import PrestationShow from './components/pages/PrestationShow';
		import RouteEdit from './components/pages/RouteEdit';
		import RouteShow from './components/pages/RouteShow';
		import RoutePkEdit from './components/pages/RoutePkEdit';
		import RoutePkShow from './components/pages/RoutePkShow';
		import EtatCreate from './components/pages/EtatCreate';
		import EtatList from './components/pages/EtatList';
		import PrestationCreate from './components/pages/PrestationCreate';
		import PrestationList from './components/pages/PrestationList';
		import RouteCreate from './components/pages/RouteCreate';
		import RouteList from './components/pages/RouteList';
		import RoutePkCreate from './components/pages/RoutePkCreate';
		import RoutePkList from './components/pages/RoutePkList';
		
  
axios.defaults.baseURL = process.env.VUE_APP_API_URL
axios.interceptors.request.use(function (config) {
  config.headers['X-Binarybox-Api-Key'] = process.env.VUE_APP_API_KEY;
  return config;
});
  
const router = createRouter({
  history: createWebHistory(),
  routes: [
    { path: '/EtatEdit/:id', component: EtatEdit  },
		{ path: '/EtatShow/:id', component: EtatShow  },
		{ path: '/PrestationEdit/:id', component: PrestationEdit  },
		{ path: '/PrestationShow/:id', component: PrestationShow  },
		{ path: '/RouteEdit/:id', component: RouteEdit  },
		{ path: '/RouteShow/:id', component: RouteShow  },
		{ path: '/RoutePkEdit/:id', component: RoutePkEdit  },
		{ path: '/RoutePkShow/:id', component: RoutePkShow  },
		{ path: '/EtatCreate', component: EtatCreate  },
		{ path: '/EtatList', component: EtatList  },
		{ path: '/PrestationCreate', component: PrestationCreate  },
		{ path: '/PrestationList', component: PrestationList  },
		{ path: '/RouteCreate', component: RouteCreate  },
		{ path: '/RouteList', component: RouteList  },
		{ path: '/RoutePkCreate', component: RoutePkCreate  },
		{ path: '/RoutePkList', component: RoutePkList  },
		
  ],
});
  
createApp(App).use(router).mount('#app');
